import classes from './Header.module.css';
import img from '../../../assets/meals.jpg'

const Header = () => {
    return (
        <>
            <header className={classes.header}>
                <h1>A Restaurant</h1>
                <button>Cart</button>
            </header>
            <div>
                <img
                    className={classes.main-image}
                    src={img}
                />
            </div>
        </>
    )
}

export default Header;
